description:
    Inspired by classic action and RTS games like Cannon Fodder, Commando, Who Dares Wins, and Dogs of War.
    The safe way to fight in a war: You won't end up in a body bag.
    Lead your troopers in 30 missions with varied objectives.
    Use special units like Delta Force for extra firepower.
    Easy to use controls: just tap to move and shoot.
    Awesome 3D graphics.
